import React, { useState } from 'react';
import ApiService from '../services/ApiService';
import './index.css';

const Prediccion = () => {
  const [formulario, setFormulario] = useState({
    numeroAdultos: '',
    numeroNinos: '',
    tipoHabitacion: 'Doble',
    precioHabitacion: '',
    duracionEstancia: '',
    diaSemanaCheckIn: 'Friday',
    mesCheckIn: '',
    antiguedadReserva: ''
  });

  const [resultado, setResultado] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormulario(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await ApiService.predecirCancelacion(formulario);
      setResultado(response);
    } catch (error) {
      console.error('Error al predecir cancelaci√≥n:', error);
    }
  };

  return (
    <div className="prediccion-container">
      <h1>üß† Predicci√≥n de Cancelaci√≥n</h1>

      <form onSubmit={handleSubmit}>
        <input type="number" name="numeroAdultos" placeholder="N√∫mero de Adultos" value={formulario.numeroAdultos} onChange={handleChange} required />
        <input type="number" name="numeroNinos" placeholder="N√∫mero de Ni√±os" value={formulario.numeroNinos} onChange={handleChange} required />
        <input type="number" name="precioHabitacion" placeholder="Precio de Habitaci√≥n" value={formulario.precioHabitacion} onChange={handleChange} required />
        <input type="number" name="duracionEstancia" placeholder="Duraci√≥n de Estancia (d√≠as)" value={formulario.duracionEstancia} onChange={handleChange} required />
        <input type="number" name="mesCheckIn" placeholder="Mes del Check-In" value={formulario.mesCheckIn} onChange={handleChange} required />
        <input type="number" name="antiguedadReserva" placeholder="Antig√ºedad de la Reserva (d√≠as)" value={formulario.antiguedadReserva} onChange={handleChange} required />

        <select name="tipoHabitacion" value={formulario.tipoHabitacion} onChange={handleChange}>
          <option value="Doble">Doble</option>
          <option value="Suite">Suite</option>
          <option value="Individual">Individual</option>
        </select>

        <select name="diaSemanaCheckIn" value={formulario.diaSemanaCheckIn} onChange={handleChange}>
          <option value="Monday">Lunes</option>
          <option value="Tuesday">Martes</option>
          <option value="Wednesday">Mi√©rcoles</option>
          <option value="Thursday">Jueves</option>
          <option value="Friday">Viernes</option>
          <option value="Saturday">S√°bado</option>
          <option value="Sunday">Domingo</option>
        </select>

        <button type="submit">Predecir Cancelaci√≥n</button>
      </form>

      {resultado && (
        <div className="prediccion-resultado">
          <p>
            ¬øCancelar√°?{' '}
            {resultado.resultado === 'Si' ? (
              <span className="text-red-600">‚ùå S√≠</span>
            ) : (
              <span className="text-green-600">‚úÖ No</span>
            )}
          </p>
          <p>
            Confianza del modelo:{' '}
            <strong>{Math.round(resultado.confianza * 100)}%</strong>
          </p>
        </div>
      )}
    </div>
  );
};

export default Prediccion;
